package ui

import (
	"encoding/base64"
	"ev0CloudConfig/gist"
	"image"
	_ "image/png"
	"os"
	"strings"

	"github.com/atotto/clipboard"
	"github.com/google/go-github/github"
	log "github.com/sirupsen/logrus"

	ui "github.com/gizak/termui/v3"
	"github.com/gizak/termui/v3/widgets"
)

const evologo = ``

// UI main ui component
func UI(configs []string, csgopath string, client *github.Client) {
	if err := ui.Init(); err != nil {
		log.Fatalf("failed to initialize ui: %v", err)
	}
	defer ui.Close()

	l := widgets.NewList()
	l.Title = "Configs"
	l.Rows = configs
	l.TextStyle = ui.NewStyle(ui.ColorGreen)
	l.WrapText = false
	l.SetRect(0, 0, 25, 8)

	ui.Render(l)

	previousKey := ""
	uiEvents := ui.PollEvents()
	for {
		e := <-uiEvents
		switch e.ID {
		case "q", "<C-c>":
			return
		case "j", "<Down>":
			l.ScrollDown()
		case "k", "<Up>":
			l.ScrollUp()
		case "<C-d>":
			l.ScrollHalfPageDown()
		case "<C-u>":
			l.ScrollHalfPageUp()
		case "<C-f>":
			l.ScrollPageDown()
		case "<C-b>":
			l.ScrollPageUp()
		case "g":
			if previousKey == "g" {
				l.ScrollTop()
			}
		case "<Home>":
			l.ScrollTop()
		case "G", "<End>":
			l.ScrollBottom()
		case "<Enter>":
			res, err := gist.Create(client, csgopath+`\ev0lve\`+configs[l.SelectedRow], configs[l.SelectedRow])
			if err == nil {
				clipboard.WriteAll(*res.HTMLURL)
			} else {
				log.Info(err)
				os.Exit(0)
			}
		}

		if previousKey == "g" {
			previousKey = ""
		} else {
			previousKey = e.ID
		}

		p := widgets.NewParagraph()
		p.Text = "-> Use vi controls or up and down to navigate\n-> Press enter to upload the config to github gist\n-> URL will be copied to the clipboard \n-> q to exit\n-> Made by bay"
		p.Title = "ev0-cloud-config"

		image, _, _ := image.Decode(base64.NewDecoder(base64.StdEncoding, strings.NewReader(evologo)))
		img := widgets.NewImage(image)
		img.SetRect(0, 0, 100, 100)

		grid := ui.NewGrid()
		termWidth, termHeight := ui.TerminalDimensions()
		grid.SetRect(0, 0, termWidth, termHeight)

		grid.Set(
			ui.NewRow(1.0/1,
				ui.NewCol(1.0/2, l),
				ui.NewCol(1.0/2,
					ui.NewRow(1.0/2, img),
					ui.NewRow(1.0/2, p),
				),
			),
		)
		ui.Render(grid)
	}
}
